var React = require('react');
var YYClass = require('../base/YYClass');
var PropTypes = YYClass.PropTypes;
var field = YYClass.field;

var _require = require('antd'),
    Timeline = _require.Timeline;

require('./style/index.less');
//定义META
var uiMeta = {
    name: 'timeline',
    fields: [
    //field参数列表：字段属性名|属性默认值|属性类型|是否必填|属性描述
    field('pending', false, PropTypes.oneOfType([PropTypes.element, PropTypes.bool]), false, '指定最后一个幽灵节点是否存在或内容')]
};
var YYTimeline = YYClass.create({
    uiMeta: uiMeta
    /*,statics:{
        Item:Timeline.Item
    }*/
    , getInitialState: function getInitialState() {
        return {};
    },
    render: function render() {
        var cls = this.className();
        return React.createElement(
            'div',
            { className: cls },
            React.createElement(
                Timeline,
                this.props,
                this.props.children
            )
        );
    }
});
module.exports = YYTimeline;